import List from './pages/List'
import Home from './pages/Home'
import {BrowserRouter as Router,Route,Redirect} from 'react-router-dom'
const name="unknown";

function App() {
  return (
    <Router>
      <Route path="/" exact>
        <Home/>
      </Route>
      <Route path="/list" exact>
        <List/>
      </Route>
      <Redirect to='/'/>
    </Router>
  );
}

export default App;
